import React from 'react';
import '../rightBar/rightBar.css';
import {
    NavLink
} from 'react-router-dom';
import {
    useHttp
} from '../../hooks/http.hook';

const NewsContent = () => {
    return ( <
        div className = 'newsBlock' >
        <
        img src = {
            images
        } > < /img> <
        span > {
            text
        } < /span> <
        /div>
    )
}

export default NewsContent;
